new_values = []
for title, values in items.items():
    r = requests.get('https://api.jikan.moe/v4/anime', params={'q': title}, verify=False)
    time.sleep(2)
    if r.status_code == 200:
        data = r.json()
        # print(data['data'])
        for result in data['data']:
            name = result['title']
            mal_id = result['mal_id']
            if name == title:
                for value in values:
                    entry = {}
